import React from 'react';
import {
Nav,
NavLink,
Bars,
NavMenu,
NavBtn,
NavBtnLink,
} from './NavbarElements';

const Navbar = () => {
return (
	<>
	<Nav>
		<Bars />

		<NavMenu>
		<a  activeStyle>
			Home
		</a>
		<a  activeStyle>
			Products
		</a>
		<a to='/annual' activeStyle>
			About
		</a>
		<a to='/team' activeStyle>
			Contact Us
		</a>

		{/* Second Nav */}
		{/* <NavBtnLink to='/sign-in'>Sign In</NavBtnLink> */}
		</NavMenu>

	</Nav>
	</>
);
};

export default Navbar;
